クロージャを引数のパラメータとして用いることができるのと同様に、クロージャを戻り値として返すことも可能です。しかし無名のクロージャの型はその定義上、不明であるため、クロージャを返すためにはimpl Traitを使用する必要があります。 クロージャを返すために有効なトレイトは下記の通りです。 Fn FnMut FnOnce 更に、moveというキーワードを使用し、全ての捕捉が値でおこなわれることを明示しなければなりません。 これは、関数を抜けると同時に参照による捕捉がドロップされ、無効な参照がクロージャに残ってしまうのを防ぐためです。 fn create_fn() -> impl Fn() { let text = "Fn".to_owned(); move || println!("This is a: {}", text)
} fn create_fnmut() -> impl FnMut() { let text = "FnMut".to_owned(); move || println!("This is a: {}", text)
} fn create_fnonce() -> impl FnOnce() { let text = "FnOnce".to_owned(); move || println!("This is a: {}", text)
} fn main() { let fn_plain = create_fn(); let mut fn_mut = create_fnmut(); let fn_once = create_fnonce(); fn_plain(); fn_mut(); fn_once();
}

