iterator::anyは、イテレータ内に一つでも条件を満たす要素があれば、trueを返し、さもなくばfalseを返すイテレータです。以下がそのシグネチャです pub trait Iterator { // The type being iterated over. // イテレートされる値の型 type Item; // `any` takes `&mut self` meaning the caller may be borrowed // and modified, but not consumed. // `any`は`&mut self`を取るため、イテレータを呼び出した値を借用し // 変更しますが、消費し尽くすことはありません。 fn any<F>(&mut self, f: F) -> bool where // `FnMut` meaning any captured variable may at most be // modified, not consumed. `Self::Item` states it takes // arguments to the closure by value. // `FnMut`はクロージャによって補足される変数が変更される // 事はあっても消費されることはないということを示します。 // `Self::Item`はクロージャが変数を値として取ることを示します。 F: FnMut(Self::Item) -> bool {}
} fn main() { let vec1 = vec![1, 2, 3]; let vec2 = vec![4, 5, 6]; // `iter()` for vecs yields `&i32`. Destructure to `i32`. // ベクトル型に対する`iter`は`&i32`を`yield`するので、`i32`へとデストラクト println!("2 in vec1: {}", vec1.iter() .any(|&x| x == 2)); // `into_iter()` for vecs yields `i32`. No destructuring required. // `into_iter()`の場合は`i32`を`yield`するので、デストラクトする必要はない。 println!("2 in vec2: {}", vec2.into_iter().any(| x| x == 2)); let array1 = [1, 2, 3]; let array2 = [4, 5, 6]; // `iter()` for arrays yields `&i32`. // 配列に対する`iter()`は`&i32`をyieldする。 println!("2 in array1: {}", array1.iter() .any(|&x| x == 2)); // `into_iter()` for arrays unusually yields `&i32`. // 配列に`into_iter()`を使うと例外的に`&i32`を`yield`する。 println!("2 in array2: {}", array2.into_iter().any(|&x| x == 2));
}

