impl Iterator for Fibonacci { // We can refer to this type using Self::Item type Item = u32; // Here, we define the sequence using `.curr` and `.next`. // The return type is `Option<T>`: // * When the `Iterator` is finished, `None` is returned. // * Otherwise, the next value is wrapped in `Some` and returned. // We use Self::Item in the return type, so we can change // the type without having to update the function signatures. // ここではイテレーションの流れを`.curr`と`.next`を使用して定義している。 // 返り値の型は`Option<T>`で、これは: // * `Iterator`が終了した時は`None`を返し、 // * そうでなければ`Some`でラップされた値を返す。 fn next(&mut self) -> Option<Self::Item> { let new_next = self.curr + self.next; self.curr = self.next; self.next = new_next; // Since there's no endpoint to a Fibonacci sequence, the `Iterator` // will never return `None`, and `Some` is always returned. // フィボナッチ数列には終端がないので、`Iterator`は決して // `None`を返さず、常に`Some`が返される。 Some(self.curr) }
