Rustにおいて、すべての値はデフォルトでスタックに割り当てられます。Box<T>を作成することで、値を ボックス化 、すなわちヒープ上に割り当てることができます。ボックスとは正確にはヒープ上におかれたTの値へのスマートポインタです。ボックスがスコープを抜けると、デストラクタが呼ばれて内包するオブジェクトが破棄され、ヒープメモリが解放されます。 ボックス化された値は*オペレータを用いてデリファレンスすることができます。これにより一段と直接的な操作が可能になります。 use std::mem; #[allow(dead_code)]
#[derive(Debug, Clone, Copy)]
struct Point { x: f64, y: f64,
} // A Rectangle can be specified by where its top left and bottom right // corners are in space
#[allow(dead_code)]
struct Rectangle { top_left: Point, bottom_right: Point,
} fn origin() -> Point { Point { x: 0.0, y: 0.0 }
} fn boxed_origin() -> Box<Point> { // Allocate this point on the heap, and return a pointer to it // このPointをヒープ上に割り当て、ポインタを返す。 Box::new(Point { x: 0.0, y: 0.0 })
} fn main() { // (all the type annotations are superfluous) // Stack allocated variables // （以下では型を全て明示していますが、必須ではありません。） // この変数ははすべてスタック上に割り当てられる。 let point: Point = origin(); let rectangle: Rectangle = Rectangle { top_left: origin(), bottom_right: Point { x: 3.0, y: -4.0 } }; // Heap allocated rectangle // ヒープ上に割り当てられたRectangle let boxed_rectangle: Box<Rectangle> = Box::new(Rectangle { top_left: origin(), bottom_right: Point { x: 3.0, y: -4.0 }, }); // The output of functions can be boxed // 関数の返り値をボックス化 let boxed_point: Box<Point> = Box::new(origin()); // Double indirection // 間にもう一つポインタを挟む let box_in_a_box: Box<Box<Point>> = Box::new(boxed_origin()); println!("Point occupies {} bytes on the stack", mem::size_of_val(&point)); println!("Rectangle occupies {} bytes on the stack", mem::size_of_val(&rectangle)); // box size == pointer size // ボックスのサイズはポインタのサイズに等しい println!("Boxed point occupies {} bytes on the stack", mem::size_of_val(&boxed_point)); println!("Boxed rectangle occupies {} bytes on the stack", mem::size_of_val(&boxed_rectangle)); println!("Boxed box occupies {} bytes on the stack", mem::size_of_val(&box_in_a_box)); // Copy the data contained in `boxed_point` into `unboxed_point` // `boxed_point`の保持するデータを`unboxed_point`にコピーする let unboxed_point: Point = *boxed_point; println!("Unboxed point occupies {} bytes on the stack", mem::size_of_val(&unboxed_point));
}

