ecause it is called later. // An attempt to reborrow will lead to an error. // クロージャはまだ `count` をミュータブルで借用している。 // なぜなら後で呼ばれるからである。 // 再借用しようとするとエラーになる。 // let _reborrow = &count; // ^ TODO: try uncommenting this line. // ^ TODO: この行のコメントアウトを解除しましょう。 inc(); // The closure no longer needs to borrow `&mut count`. Therefore, it is // possible to reborrow without an error // クロージャはもう`&mut count`を借用する必要がない。 // なので、エラーを起こさず再借用することができる。 let _count_reborrowed = &mut count; // A non-copy type. // コピー不可能な型 let movable = Box::new(3); // `mem::drop` requires `T` so this must take by value. A copy type // would copy into the closure leaving the original untouched. // A non-copy must move and so `movable` immediately moves into // the closure. // `mem::drop`は`T`（ジェネリック型）を取る必要があるため、このクロージャは // 参照ではなく値を取る。その場合、もしもコピー可能な値ならば、 // 元の値はそのままでコピーのみを取る。不可能ならば値そのものを移動させる。 let consume = || { println!("`movable`: {:?}", movable); mem::drop(movable); }; // `consume` consumes the variable so this can only be called once. // `consume`は変数を消費（開放）するため、一度しか呼び出すことができない。 consume(); // consume(); // ^ TODO: Try uncommenting this line. // ^ TODO: この行のコメントアウトを解除しましょう。
